import React, { Component } from "react";
import "./Navbar.css";

class Sidenav extends Component {
  render() {
    return (
      <div className="sidenav">
        <a className="brand" href="/">
          Contact List
          <hr />
        </a>

        <a href="">Add New Contact</a>
      </div>
    );
  }
}

export default Sidenav;
